DROP TABLE IF EXISTS `harvests`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `harvests` (
  `ID_harvest` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique, automatically incremented, primary key integer, identifying the harvest',
  `ID_site` int(11) NOT NULL DEFAULT '0',
  `ID_leader` int(5) DEFAULT '0' COMMENT 'Unique, secondary key, integer identifying the harvest leader- see pickers table',
  `ID_leader2` int(5) DEFAULT '0' COMMENT 'Unique, secondary key, integer identifying the harvest co-leader- see pickers table',
  `ID_coordinator` int(5) DEFAULT NULL,
  `h_date` varchar(10) DEFAULT '0000-00-00' COMMENT 'harvest date yyyy-mm-dd',
  `h_time` time DEFAULT NULL COMMENT 'harvest time hh:mm:ss',
  `duration` decimal(4,1) DEFAULT NULL,
  `carpool` varchar(6) CHARACTER SET latin1 NOT NULL DEFAULT 'none',
  `pooltime` time DEFAULT NULL,
  `spot` int(11) NOT NULL DEFAULT '0',
  `adjwgt` smallint(5) DEFAULT NULL,
  `calcwgt` smallint(6) DEFAULT NULL COMMENT 'donated weight of produce',
  `totwgt` smallint(6) DEFAULT NULL,
  `donwgt` int(11) DEFAULT NULL,
  `pick_num` smallint(4) DEFAULT NULL COMMENT 'number of roster slots',
  `SHT` varchar(3) CHARACTER SET latin1 DEFAULT 'No' COMMENT 'Select Harvest Team only (Yes/No)',
  `where_to` varchar(60) CHARACTER SET latin1 DEFAULT NULL,
  `otherinfo` varchar(1000) CHARACTER SET latin1 DEFAULT NULL COMMENT 'short desdriuption of the harvest displayed on the Harvest Parties page',
  `longinfo` varchar(4000) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Longer information given to pickers after signup, usually including directions',
  `gmap` varchar(3) CHARACTER SET latin1 DEFAULT 'Yes',
  `status` varchar(20) CHARACTER SET latin1 DEFAULT 'closed' COMMENT 'harversts status as ''open'' for public signup or  ''closed''',
  `taxdate` varchar(10) DEFAULT NULL COMMENT 'date tax donation receipt sent by Secretary',
  `summary` varchar(10) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Harvest Summary documentation received',
  `surveysent` varchar(4) CHARACTER SET latin1 DEFAULT 'No' COMMENT 'Crop onwer survey has been sent (Yes/No)',
  `KeyRec` int(5) DEFAULT NULL,
  `type` varchar(12) CHARACTER SET latin1 DEFAULT NULL,
  `delivered` varchar(3) CHARACTER SET latin1 DEFAULT NULL,
  `miles` smallint(11) DEFAULT NULL,
  `triphours` decimal(4,2) DEFAULT NULL,
  `kindmiles` smallint(11) DEFAULT NULL,
  `volcars` int(11) DEFAULT NULL,
  `volextra` decimal(4,2) DEFAULT NULL,
  `soon` varchar(3) NOT NULL DEFAULT 'Yes',
  `crop1` smallint(6) DEFAULT NULL,
  `wgt1` smallint(6) DEFAULT NULL,
  `crop2` smallint(6) DEFAULT NULL,
  `wgt2` smallint(6) DEFAULT NULL,
  `crop3` smallint(6) DEFAULT NULL,
  `wgt3` smallint(6) DEFAULT NULL,
  `crop4` smallint(6) DEFAULT NULL,
  `wgt4` smallint(6) DEFAULT NULL,
  `crop5` smallint(6) DEFAULT NULL,
  `wgt5` smallint(6) DEFAULT NULL,
  `crop6` smallint(6) DEFAULT NULL,
  `wgt6` smallint(6) DEFAULT NULL,
  `crop7` smallint(6) DEFAULT NULL,
  `wgt7` smallint(6) DEFAULT NULL,
  `crop8` smallint(6) DEFAULT NULL,
  `wgt8` smallint(6) DEFAULT NULL,
  `crop9` smallint(6) DEFAULT NULL,
  `wgt9` smallint(6) DEFAULT NULL,
  `crop10` smallint(6) DEFAULT NULL,
  `wgt10` smallint(6) DEFAULT NULL,
  PRIMARY KEY (`ID_harvest`)
) ENGINE=MyISAM AUTO_INCREMENT=1386 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

