ed fruit tree skills into practice. We will be winter pruning and setting up spaces for mason bees at the Korean Women\'s Association Orchard in Roy, WA. \r\n\r\nThese apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women\'s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as EFN\'s broader network of food banks.  \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 12pm. We have about','This is a unique opportunity to learn about orchard management, and to put newly learned fruit tree skills into practice. We will be winter pruning and setting up spaces for mason bees at the Korean Women\'s Association Orchard in Roy, WA. \r\n\r\nThese apple trees are well cared for by orchard managers, Sok and Sun Dang, but are suffering problems due to the way they were originally planted years ago. Usually, this orchard produces 5,000lbs of fruit, but this year it only produced 115lbs. This is the first Work & Learn party in a series of four, and each will address a different piece of a comprehensive plan of getting this orchard back on track. This orchard is a cooperation with the Emergency Food Network (EFN) and the Korean Women\'s Association (KWA). The fruit goes to support the low-income families living around the orchard, as well as EFN\'s broader network of food banks.  \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 12pm. We have about seven spaces available in the Harvest Pierce County van, so 