s accordingly and bring a water bottle. We\'ll be out in a field picking so boots or sturdy shoes are recommended.','If you need to carpool please note that our meet up spot is in front of the Wright Park lion statues on 6th/S.Yakima. There are 3 spots in the staff vehicle and you will need to arrive by 8am sharp to carpool with staff to Scholz Farm. If all three spaces are filled but there are additional drivers available, the Harvest Leader will connect you by email so that you can coordinate a ride.\r\n\r\nPlease put the following address in your GPS: 14310 128th Street East, Puyallup, WA 98374. You will see the Scholz Farm sign on your left as you approach the driveway to address above, as well as a wooden Harvest Pierce County sign in front of the driveway. Pull in and park by the barn in the back. We will gather nearby and then head to the field where the green beans are. Please aim to arrive on time and stay for the duration of the harvest. If you are late to the event or need to leave early, you will need to contact Mason (253-468-3749) to let them know. This is to ensure that we have enough pickers to get the glean done! Thanks for understanding.','Yes','closed',NULL,NULL,'No',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yes',37,606,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0),(412,261,305,NULL,NULL,'2016-09-29','10:00:00',2.0,'option','10:00:00',5,NULL,78,78,50,4,'No','St. Leo\'s','Grapes are ripe for the picking at this house! For the carpool option, meet at the south end of Wright Park near the lions statues.',NULL,'No','closed',NULL,NULL,'No',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yes',83,78,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0),(413,99,360,NULL,NULL,'2016-10-01','13:00:00',2.0,'option','12:00:00',5,NULL,6635,6635,6635,20,'No','Emergency Food Network','This is a unique harvest opportunity. We will be harvesting at the Korean Women\'s Association Orchard in Roy, WA. These a well cared for apple trees by orchard 