 We will glean storage varieties that will last for a few months in storage and will be an incredible donation to the emergency food system. Others are fresh harvest varieties that have a 1-2 week shelf life. Volunteers will help pick and wash the carrots, and should anticipate getting a little bit muddy on the farm, so dress appropriately! Bring your own bags if you would like to take home a portion of the harvest.\r\n\r\n','If you wish to carpool, meet at the lion statues on the south side of Wright Park in Tacoma at 12:30pm. If you are carpooling with staff you will be asked to help with dropping off donations before returning to Wright Park.\r\n\r\nIf you choose to drive yourself, please park on the grass on the side of the road in front of the farm, or if these spaces are full, by the red barn beyond the driveway.\r\n','Yes','closed',NULL,NULL,'No',NULL,'Field',NULL,NULL,NULL,NULL,NULL,NULL,'Yes',28,407,89,4,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0),(444,216,320,NULL,NULL,'2016-11-19','09:00:00',NULL,'none','00:00:00',0,NULL,2612,2612,2612,NULL,'No',NULL,'This is the total poundage harvested at Veggie Co-op from October 1st-November 19th. It should count toward the 4th quarter Gleaning report.\r\n\r\n',NULL,'No','closed',NULL,NULL,'No',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yes',44,2612,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0),(445,392,502,NULL,NULL,'2016-12-16','13:00:00',2.0,'option','12:30:00',5,NULL,0,0,NULL,5,'No',NULL,'Come glean persimmon fruit from a tree at a site near University Place! There are only about 100 or so persimmons on this tree and so be aware that this will be a shorter harvest event. We will donate a portion of the fruit but also bring your own bags to bring some home. We\'ll keep an eye on the weather in case of snow but in order to catch this fruit we will likely pick rain or shine--so come prepared with warm clothes and perhaps a hot drink to sip on!','There is a carpool option available for this harvest and there are 2 open seats in the staff vehicle. Please meet us at the lion statues in front of Wright Park on 6th Ave at 12:30pm to carpool.','No','closed',NULL,NULL,'No',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yes',49,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0),(446,99,360,634,NULL,'2017-03-11','11:00:00',3.0,'option','10:00:00',0,NULL,0,0,NULL,10,'No',NULL,'This is a work and learn party as a follow up to Robert Sweet\'s 3/6 Winter Pruning class. We will be pruning at the Korean Women\'s Association Orchard in Roy, WA. We will have some tools for people to use in case they forgot theirs, but in general please bring your own tools because it is best to learn on your own equipment! If you have any pruning tools to share, that would also be helpful. :-) \r\n\r\nA pizza lunch will be provided by the Korean Women\'s Association as a thank you for your care in the orchard! Please be sure and register yourself and everyone coming with you so that we know how much pizza to order. \r\n\r\nWe know there is rain in the forecast, so we will have a covered shed with a space heater, tea, and snacks so that you\'ll have a space to warm up and dry off. \r\n\r\nCarpooling available from the south end of Wright Park in Tacoma, by the lion statues, at 10am. If you are driving yourself, please park by the storage unit that you will see after entering the property\'s fencelin',NULL,'Yes','closed',NULL,NULL,'No',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Yes',45,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0,NULL,0),(447,16,360,NULL,NULL,'2017-06-14','16:00:00',2.0,'option','16:00:00',0,NULL,0,0,NULL,35,'No',NULL,'Are you interested in being a Harvest Leader? Come learn how to do it with us! \r\nThis is a hands-on training: From start to finish, we\'re going to go through the motions of a glean together, so you can see what it takes to be a Harvest Leader for the Gleaning Project! \r\n\r\nWe\'ll start at our Wright Park Office at 4pm (https://