  `email2` varchar(60) DEFAULT NULL,
  `contact3` varchar(60) DEFAULT NULL,
  `phone3` varchar(50) DEFAULT NULL,
  `email3` varchar(60) DEFAULT NULL,
  `maddress` varchar(80) DEFAULT NULL,
  `mcity` varchar(80) DEFAULT NULL,
  `mstate` varchar(2) DEFAULT 'WA',
  `mzip` varchar(5) DEFAULT NULL,
  `address` varchar(80) DEFAULT NULL,
