INSERT INTO `sqllibrary` VALUES (1,'Email addresses grouped by domain','select count(email), right(email,length(email)-locate(\'@\',email)) from pickers group by right(email,length(email)-locate(\'@\',email)) order by count(email) desc'),(2,'Weight per picker by harvest with crop type','select crop_type, tlname,count(rosters.status) as \'actual pickers\',round(total_lbs/count(rosters.status)) as \'lbs per picker\' from trees, harvests,rosters where total_lbs>0 and harvests.ID_harvest=rosters.ID_harvest and harvests.ID_crop=trees.ID_crop and(rosters.status=\'harvested\' or rosters.status=\'intake\'or rosters.status=\'leader\' ) group by harvests.ID_harvest order by crop_type, tlname'),(7,'Names and emails of pickers ordered by number of harvests attended (if more than 0)','select pickers.fname, pickers.lname, pickers.email, count(rosters.status) from pickers, rosters where rosters.ID_picker=pickers.ID_picker and (rosters.status=\'harvested\' or rosters.status=\'intake\') and pickers.ID_picker<>0 group by rosters.ID_picker order by count(rosters.status) desc'),(8,'Harvest list - pounds per picker','select trees.tfname, trees.tlname, trees.crop_type, pickers.lname as leader, total_lbs, pick_num, round(total_lbs/pick_num) as \'lbs/picker\' from harvests, trees, pickers where trees.ID_crop=harvests.ID_crop and pickers.ID_picker=harvests.ID_leader and h_date>\'2012-06-01\' and total_lbs>.5 order by total_lbs/pick_num DESC'),(9,'Harvests in a date range (total)','select lname as Leader, tlname as Owner, crop_type as \'Crop type\', h_date as \'Harvest date\', total_lbs as \'Pounds picked\' from harvests,trees, pickers where h_date>\'2012-09-10\' and h_date<\'2012-09-16\' and harvests.ID_crop=trees.ID_crop and harvests.ID_leader=pickers.ID_picker order by h_date'),(31,'Top 30 assistants','select pickers.lname, pickers.fname, count(rosters.ID_picker) from pickers, rosters where rosters.ID_picker=pickers.ID_picker and rosters.status=\'intake\' and rosters.ID_picker<>0 group by rosters.ID_picker order by count(rosters.ID_picker) desc limit 30'),(11,'Number of times signed up to assist','select fname, lname, count(ID_picker)from rosters where status=\'intake\' and regdate&gt;\'2011-07-01\' group by ID_picker, status order by count(ID_picker) desc'),(13,'Distinct pickers by roster status','select status, count(distinct(ID_picker)) from rosters where regdate>\'2013-01-01\' group by status'),(26,'Total registered pickers','select count(ID_picker) as \'Total registered pickers\' from pickers '),(16,'Participants and attendance percentage, by harvest','select harvests.ID_harvest, h_date, tlname, crop_type, count(rosters.status) as participants, round(100*(count(rosters.status)/pick_num)) as attendance from harvests, rosters, trees where harvests.ID_harvest=rosters.ID_harvest and trees.ID_crop=harvests.ID_crop and h_date>\'2012-01-01\' and rosters.status<>\'absent\' and rosters.status<>\'cancel\' group by harvests.ID_harvest order by h_date'),(18,'Harvest dates, pounds, crop, pickers to Oceano Warehouse','select h_date as Date, crop_type as Crop, weight as Pounds, count(rosters.status) as Pickers from harvests, trees, rosters where trees.ID_crop=harvests.ID_crop and rosters.ID_harvest=harvests.ID_harvest and rosters.status<>\'cancel\' and rosters.status<>\'absent\' and where_to=\'Oceano Warehouse\' group by harvests.ID_harvest'),(30,'Top 30 harvest participants','select pickers.lname, pickers.fname, count(rosters.ID_picker) from pickers, rosters where rosters.ID_picker=pickers.ID_picker and (rosters.status=\'harvested\' or rosters.status=\'intake\' or rosters.status=\'leader\') and rosters.ID_picker<>0 group by rosters.ID_picker order by count(rosters.ID_picker) desc limit 30'),(29,'Total pounds picked and donated, by year','select year(h_date) as Year, sum(weight) as \'Pounds donated\', sum(total_lbs) as \'Total weight\' from harvests where year(h_date)<>0 group by year(h_date) order by year(h_date)'),(35,'Total distinct pickers, by year','select year(h_date) as Year, count(distinct ID_picker) as \'Total distinct pickers\' from rosters, harvests where harvests.ID_harvest=rosters.ID_harvest and rosters.status<>\'cancel\' and rosters.status<>\'absent\' group by year(h_date) order by year(h_date)'),(40,'Most often absent','select fname, lname, count(status) from rosters where status=\'absent\' group by ID_picker order by count(status) desc limit 33\r\n'),(42,'Most often cancelled','select fname, lname, count(status) from rosters where status=\'cancel\' group by ID_picker order by count(status) desc limit 33\r\n'),(46,'Volunteers with the same name +Webmaster+','select id_picker,fname, lname from pickers where dupname=\'yes\''),(49,'Pounds per picker for a particular crop type','select trees.tfname, trees.tlname, trees.crop_type, total_lbs, pick_num, round(total_lbs/pick_num) as \'lbs/picker\' from harvests, trees where trees.ID_crop=harvests.ID_crop and crop_type=\'Blueberries\' and total_lbs>.5 order by total_lbs/pick_num DESC'),(50,'Crop owner survey results','select tfname, tlname, crops, surveydate, most, better, other, quote as \'May use quotes\' from surveyowner, trees, harvests where trees.ID_crop=harvests.ID_crop and harvests.ID_harvest=surveyowner.ID_harvest order by surveydate Desc'),(60,'Harvests by specified harvest leader','select tlname, crop_type, pick_num, total_lbs from harvests, trees where trees.ID_crop=harvests.ID_crop and ID_leader=1 and h_date>\'2012-01-01\''),(105,'Donations in 2013 -  weight grouped by agency','select where_to, sum(weight) from harvests, trees where trees.ID_crop=harvests.ID_crop and h_date>\'2013-01-01\' and weight>0 group by where_to'),(64,'Pounds, pounds per picker, number of pickers, crop type, owner, leader, for BY harvests','select ID_harvest, pick_num, total_lbs, round(total_lbs/pick_num) as \'lbs per picker\', crop_type, tlname as owner, pickers.lname as leader from harvests, trees, pickers where harvests.ID_crop=trees.ID_crop and pickers.ID_picker=harvests.ID_leader and BYorFarm=\'BY\' and h_date>\'2012-05-01\' order by crop_type, total_lbs desc'),(102,'Number of crops, grouped by crop type','select crop_type, count(crop_type) from trees group by crop_type'),(103,'Donated weight since the start of 2013','select sum(weight) from harvests where h_date>\'2013-01-01\''),(104,'Donated weight by crop type','select crop_type, sum(weight) from harvests, trees where harvests.ID_crop=trees.ID_crop and h_date>\'2013-01-01\' group by crop_type'),(69,'Days from BY crop registration and 2012 harvest','select trees.regdate, h_date, datediff(h_date, trees.regdate) as \'days from registration to 2012 harvest\', lname from trees, harvests, pickers where trees.ID_crop=harvests.ID_crop and pickers.ID_picker=harvests.ID_leader and h_date>\'2012-06-01\' and BYorFarm=\'BY\'order by datediff(h_date, trees.regdate)'),(70,'Harvest leaders, by venue, 2013','select count(ID_harvest),venue, lname from trees, harvests, pickers where trees.ID_crop=harvests.ID_crop and pickers.ID_picker=harvests.ID_leader and h_date>\'2013-01-01\' group by venue, ID_leader order by venue, lname'),(72,'Harvests, total lbs, crop type, number of pickers, lbs per picker, BY or Farm in 2013','select total_lbs, crop_type, pick_num, round(weight/pick_num) as \'lbs per picker\', venue, tlname, datediff(h_date, trees.regdate) as \'days from registration to 2013 harvest\' from harvests, trees where trees.ID_crop=harvests.ID_crop and h_date<\'2013-12-01\' and h_date>\'2013-01-01\' and weight>5  order by venue desc, total_lbs desc'),(74,'Select Harvest Team','select rosters.ID_picker, rosters.fname as First, rosters.lname as Last, email, phone, count(ID_rosters) as \'Total signups\' from pickers, rosters where selectteam=\'Yes\' and pickers.ID_picker=rosters.ID_picker group by rosters.ID_picker order by rosters.lname '),(78,'Total absent and attendance percentage by harvest in 2013 (harvests with absences)','select rosters.ID_harvest, harvests.ID_leader, trees.tlname as owner, crop_type as crop, count(rosters.status) as absent, round(100-(count(rosters.status)/pick_num * 100)) as attendance from rosters, harvests,trees where harvests.ID_crop=trees.ID_crop and rosters.status=\'absent\' and harvests.ID_harvest=rosters.ID_harvest and h_date>\'2013-01-01\' group by harvests.ID_harvest  order by count(rosters.status) desc'),(85,'Unique pickers who harvested in a date range +Volunteer stats+','select count(distinct rosters.ID_picker) from rosters, harvests where rosters.ID_harvest=harvests.ID_harvest and   h_date>\'2013-01-01\' and h_date<\'2013-12-31\' and rosters.status<>\'absent\' and rosters.status<>\'cancel\''),(89,'mailing addresses for crops harvested in 2013','select tfname as \'first name\', tlname as \'last name\', maddress as \'mailing address\', mcity as city, mstate as state, mzip as zip, h_date as \'harvest date\', total_lbs, crop_type from trees, harvests where trees.ID_crop=harvests.ID_crop and h_date>\'2013-01-01\' and taxdate is null and weight<>\'\' order by h_date desc'),(100,'Contact dates in a range +Volunteer stats+','select fname, lname, contactdate from pickers where contactdate>\'2013-01-01\' and contactdate<\'2013-12-31\' order by contactdate'),(101,'page views by day and user +Webmaster+','select date(whenview), who, count(pageview) from pageslog group by who, date(whenview) order by who, date(whenview) desc'),(108,'Harvests and weights by week of the year','select count(ID_harvest) as Harvests, sum(weight) as \'Weight for the week\', date_format(h_date, \'Week %U\')as \'Week of the year\' from harvests where weight>0 and year(h_date)=\'2014\' group by week(h_date) order by h_date'),(110,'All pickers by city','select fname, lname, email, city from pickers order by city'),(111,'Total weights grouped by crop owner','select trees.tfname as \'first name\', trees.tlname as \'last name\', sum(harvests.weight) as weight from trees, harvests where trees.ID_crop=harvests.ID_crop and h_date>\'2013-01-01\' group by tlname order by tlname'),(112,'All pickers with email from a particular city','select fname, lname, email from pickers where city=\'San Luis Obispo\' and email<>\'\''),(115,'weights and harvests for a particular crop owner','select h_date as date, tlname as owner, address, weight, crop_type, where_to as \'donation site\' from harvests, trees where tlname=\'Cal Poly Organic Farm\' and harvests.ID_crop=trees.ID_crop order by h_date'),(117,'All harvests ordered by leader','select ID_harvest, ID_leader from harvests order by ID_leader'),(118,'keyrec for all harvests ordered by owner','select keyrec, ID_harvest, h_date, tlname, crop_type, weight  from harvests, trees where trees.ID_crop=harvests.ID_crop order by tlname'),(119,'keyrec search','select keyrec, ID_harvest, h_date, tlname, crop_type, total_lbs  from harvests, trees where trees.ID_crop=harvests.ID_crop and keyrec=\'00000\' order by tlname'),(122,'How did you hear about GleanSLO? +Volunteer stats+','select how_hear, count(how_hear) from pickers group by how_hear order by count(how_hear) desc'),(127,'Volunteers name, email and phone by city +Volunteer stats+','select fname, lname, phone, email from pickers where city=|city,dd-pickers,\'Mill Valley\'| and email<>\'\''),(133,'Volunteers who have never been to a harvest  +Volunteer stats+','select pickers.fname, pickers.lname, pickers.ID_picker as \'picker ID\' from pickers left join rosters on pickers.ID_picker=rosters.ID_picker where rosters.ID_picker is null '),(139,'Total volunteers on rosters who attended in 2013 (no paid staff) +Volunteer stats+','select count(rosters.ID_picker) from rosters, harvests where rosters.ID_harvest=harvests.ID_harvest and   h_date>\'2013-01-01\' and h_date<\'2013-12-31\' and rosters.status<>\'absent\' and rosters.status<>\'cancel\'  and ID_picker<>1 and ID_picker<>2'),(146,'Ikeda Brothers crop addresses +Webmaster+','select address from sites where farm=\'Ikeda Brothers\' order by address'),(147,'Ikeda harvests +Webmaster+','select calcwgt, h_date, crops.name from sites, harvests, crops  where harvests.crop1=crops.ID_crop and sites.ID_site=harvests.ID_site and farm=\'Ikeda Brothers\' order by h_date'),(144,'Year comparison of total produce picked up to the current day of the year +Harvest stats+','select year(h_date) as year, count(harvests.ID_harvest) as harvests, sum(calcwgt) from harvests where dayofyear(h_date)<=dayofyear(curdate()) and substring(h_date,-2)<>\'00\'  and calcwgt>0 group by year(h_date)'),(145,'Distinct volunteers attending gleans between two dates +Volunteer stats+','select count(distinct(ID_picker)) from rosters, harvests where rosters.ID_harvest=harvests.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and h_date between \'2014-01-01\' and \'2014-09-01\''),(148,'Pounds, pounds per picker, number of pickers, crop type, owner, leader, for BY harvests','select ID_harvest, pick_num, tlname as owner, pickers.lname as leader from harvests, trees, pickers where harvests.ID_crop=trees.ID_crop and pickers.ID_picker=harvests.ID_leader and BYorFarm=\'BY\' and h_date>\'2012-05-01\' order by crop_type, total_lbs desc'),(149,'Most harvests attended in 2015 +Renee+','select concat(fname,\' \',lname), count(ID_rosters) from pickers, rosters where rosters.ID_picker=pickers.ID_picker and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(rosters.regdate)=\'2015\' group by pickers.ID_picker order by count(ID_rosters) desc'),(150,'Volunteers who have harvested in order of registration date +Renee+','select concat(fname,\' \',lname) as name, pickers.regdate as registered, count(ID_rosters) as harvests from pickers, rosters where rosters.ID_picker=pickers.ID_picker and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(rosters.regdate)=\'2015\' group by pickers.ID_picker order by pickers.regdate asc'),(151,'Volunteers\' first harvest +Renee+','select concat(fname,\' \',lname) as name, min(harvests.h_date) as \'first harvest\' from pickers, rosters, harvests where rosters.ID_picker=pickers.ID_picker and harvests.ID_harvest=rosters.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' group by pickers.ID_picker order by min(rosters.regdate) desc'),(152,'Volunteers\' pounds picked in 2015 +Renee+','select concat(fname,\' \',lname) as name, sum(totwgt) as \'total pounds harvested\' from pickers, rosters, harvests where rosters.ID_picker=pickers.ID_picker and harvests.ID_harvest=rosters.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(h_date)=\'2015\' group by pickers.ID_picker order by sum(totwgt) desc'),(153,'<strong>Total pounds to this point in the year, by year</strong> +Harvest stats+','select year(h_date) as year, count(harvests.ID_harvest) as harvests, sum(totwgt) as \'weight\' from harvests, sites where sites.ID_site=harvests.ID_site and dayofyear(h_date)<=dayofyear(curdate()) and substring(h_date,-2)<>\'00\'  and totwgt>0 group by year(h_date)'),(154,'Distinct volunteers attending gleans between two dates +Volunteer stats+','select count(distinct(ID_picker)) from rosters, harvests where rosters.ID_harvest=harvests.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and h_date between \'2016-01-01\' and \'2016-10-01\''),(155,'2016 Volunteers who have harvested in order of registration date +Renee+','select concat(fname,\' \',lname) as name, pickers.regdate as registered, count(ID_rosters) as harvests from pickers, rosters where rosters.ID_picker=pickers.ID_picker and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(rosters.regdate)=\'2016\' group by pickers.ID_picker order by pickers.regdate asc'),(156,'2016 Distinct volunteers attending gleans between two dates +Volunteer stats+','select count(distinct(ID_picker)) from rosters, harvests where rosters.ID_harvest=harvests.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and h_date between \'2016-01-01\' and \'2016-10-01\''),(157,'Volunteers\' pounds picked in 2016 +Renee+','select concat(fname,\' \',lname) as name, sum(totwgt) as \'total pounds harvested\' from pickers, rosters, harvests where rosters.ID_picker=pickers.ID_picker and harvests.ID_harvest=rosters.ID_harvest and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(h_date)=\'2016\' group by pickers.ID_picker order by sum(totwgt) desc'),(158,'Most harvests attended in 2016 +Renee+','select concat(fname,\' \',lname), count(ID_rosters) from pickers, rosters where rosters.ID_picker=pickers.ID_picker and rosters.status<>\'absent\' and rosters.status<>\'cancel\' and year(rosters.regdate)=\'2016\' group by pickers.ID_picker order by count(ID_rosters) desc'),(159,'Total weight by year +Webmaster+','select year(h_date), sum(totwgt) from harvests group by year(h_date)'),(160,'Harvest leaders and their leader designation (data check) +Webmaster+','select ID_picker, lname, leader from harvests, pickers where harvests.ID_leader=pickers.ID_picker group by ID_picker order by leader'),(161,'All sites listed by their most recent harvests date +Site stats+','select sites.ID_site, max(h_date) from sites left join harvests on sites.ID_site=harvests.ID_site group by sites.ID_site order by max(h_date)'),(162,'All zip codes in the Sites table +Site stats+','select zip, count(zip) as \'sites in this zip\', ID_site as \'Site ID if only one - use to identify errors\' from sites group by zip order by zip'),(163,'All branches and number of sites +Sites stats+','select branches.branch, count(branches.branch) from sites left join branches on branches.branch=sites.branch group by branch'),(164,'Sites with branch = Unknown +Sites stats+','select ID_site, farm, zip, branch from sites where branch=\'Unknown\' and Active=\'Yes\''),(165,'Harvests with signup entries not updated +Harvest stats+','select fname, lname, h_date, rosters.ID_harvest, count(rosters.status) as \'signup slots\' from rosters, pickers, harvests where rosters.ID_harvest=harvests.ID_harvest and pickers.ID_picker=harvests.ID_leader and rosters.status=\'signup\' group by rosters.ID_harvest order by lname'),(166,'<strong>Total pounds to this point in the year, by year</strong> +Harvest stats+','select year(h_date) as year, count(harvests.ID_harvest) as harvests, sum(totwgt) as \'weight\' from harvests, sites where sites.ID_site=harvests.ID_site and dayofyear(h_date)<=dayofyear(curdate()) and substring(h_date,-2)<>\'00\'  and totwgt>0 group by year(h_date)'),(167,'Branch Leader Harvest List 2020','select h_date, ID_leader, where_to from harvests where h_date between \'2020-01-01\' and \'2020-10-30\' order by ID_leader\r\n'),(168,'Data dump of all sites +Sites stats+','select * from sites order by regdate desc'),(169,'Time Duration of Harvest According to Picker ID','select year(h_date), (ID_harvest), pick_num, status, sum(duration) from harvests where pick_num>1 and h_date>\'2020-01-01\' group by (ID_harvest)'),(173,'Volunteer registrations by number of registrations per day - by date +Webmaster+','select regdate, count(ID_picker) from pickers group by regdate order by regdate desc '),(171,'Volunteer registrations by number of registrations per day +Webmaster+','select regdate, count(ID_picker) from pickers group by regdate order by count(ID_picker) desc '),(172,'Volunteer registrations on a given day +Webmaster+','select fname, lname from pickers where regdate=\'2021-08-02\' '),(174,'Volunteer registrations by first name length +Webmaster+','select fname, lname from pickers order by length(fname) desc'),(175,'Volunteer registrations by state +Webmaster+','select fname, lname, length(lname), regdate, state from pickers where state<>\'\' and state<>\' \' and state<>\'WA\' and state<>\'OR\' and state<>\'ID\' and state<>\' W\' and state <>\'wa\' and state<>\'/\' and state<>\'48\' and state<>\'49\' order by state'),(176,'Volunteer registrations by zip length +Webmaster+','select fname, lname, zip from pickers where length(zip)>5 order by state'),(177,'All volunteer 